import React, { Component } from "react";
import { Card } from "./petianosStyle.js";
import fotoLambda from "../../images/lambda_transparent.png";
import Swal from "sweetalert2";

export default class CardsPetianos extends Component {
  handleClick = () => {
    Swal.fire({
      title: "Custom animation with Animate.css",
      animation: false,
      customClass: {
        popup: "jello"
      }
    });
  };
  render() {
    const { petiano } = this.props;
    return (
      <Card>
        <img
          src={fotoLambda}
          className="circle responsive-img"
          alt="imagem do petiano"
          style={{
            display: "block",
            height: "150px",
            boxSizing: "border-box",
            outline: 0,
            borderRadius: 100,
            width: "auto",
            marginLeft: "auto",
            marginRight: "auto"
          }}
          onMouseEnter={() => {
            document.body.style.cursor = "pointer";
          }}
          onMouseLeave={() => {
            document.body.style.cursor = "default";
          }}
          onClick={this.handleClick}
        />
        <strong className="center-align">{petiano.nome.split(" ")[0]}</strong>
      </Card>
    );
  }
}
